contract CreatorTokenProxy is Proxy {
  constructor(address implementation_) Proxy() {
    StorageSlotUpgradeable.getAddressSlot(0x360894a13ba1a3210667c828492db98dca3e2076cc3735a920a3ca505d382bbc).value = implementation_;
  }

  function _implementation() view internal override returns(address) {
    return StorageSlotUpgradeable.getAddressSlot(0x360894a13ba1a3210667c828492db98dca3e2076cc3735a920a3ca505d382bbc).value;
  }
}
